con:config.script:
import com.eviware.soapui.model.testsuite.TestRunner.Status

// get TestCase
def tc = testRunner.testCase.testSuite.project.testSuites["Product_FunctionalFlow_TestSuite"].testCases["Product_Functional Testcase"]

// run test synchrouously
def runner = tc.run( null, false )

// show the test case run result status
log.info "Status: $runner.status, time taken for TestCase was: $runner.timeTaken ms"
log.info "Number of test steps which ran: " + runner.results.size()

// assert that it didn't fail
assert runner.status != Status.FAILED : runner.reason

// assert that only four steps ran!!
assert runner.results.size() == 4

import com.eviware.soapui.support.GroovyUtils

// Declaring variables and importing properties

def Product_SKU = context.expand('${#TestCase#Product_SKU}')
def Product_Name = context.expand('${#TestCase#Product_Name}')
def Product_Price = context.expand('${#TestCase#Product_Price}')
def Product_attributeSetId = context.expand('${#TestCase#Product_attributeSetId}')
def Product_typeId = context.expand('${#TestCase#Product_typeId}')

// import the Request property of CreateNewProduct Step

def createNewProductReqXml = context.expand('${CreateNewProduct#Request}')
//log.info createNewProductReqXml

// Creating a XML holder
def gUtil = new GroovyUtils(context)
def Xmlhol = gUtil.getXmlHolder(createNewProductReqXml)

// changing value of elements

Xmlhol.setNodeValue("//*:sku", Product_SKU)
Xmlhol.setNodeValue("//*:name", Product_Name)
Xmlhol.setNodeValue("//*:attributeSetId", Product_attributeSetId)
Xmlhol.setNodeValue("//*:price", Product_Price)
Xmlhol.setNodeValue("//*:typeId", Product_typeId)

// set the modified XML value to the Create New Product#Request Property
def modifiedXmlAsString = Xmlhol.getXml()
//log.info(modifiedXmlAsString)
testRunner.testCase.getTestStepByName("CreateNewProduct").setPropertyValue("Request",modifiedXmlAsString)

// Run the Create New Product#Request
testRunner.testCase.testSuite.project.testSuites["Product_E2ESystem TestSuite"].testCases["Product_E2E System Testcase"].testSteps["CreateNewProduct"].run(testRunner,context)

// Get the response property from Create New Product
def createNewProductResXml = context.expand('${CreateNewProduct#Response}')

// create an xml holder to get create new product response
def Xmlhol1 = gUtil.getXmlHolder(createNewProductResXml )

def Product_Id = Xmlhol1.getNodeValue("//*:id")
log.info( "Created new Product Id: " + Product_Id )
testRunner.testCase.setPropertyValue("NewProductId", Product_Id)

// import the Request property of GetProductBySKUandID
def getProductReqXml = context.expand('${GetProductBySKUandID#Request}')
def Xmlhol2 = gUtil.getXmlHolder(getProductReqXml)

// changing value of elements
Xmlhol2.setNodeValue("//*:sku",Product_SKU)
Xmlhol2.setNodeValue("//*:id",Product_Id)

// set the modified XML value to the GetProductBySKUandID#Request Property
def modifiedXmlAsString1 = Xmlhol2.getXml()
//log.info modifiedXmlAsString1
testRunner.testCase.getTestStepByName("GetProductBySKUandID").setPropertyValue("Request",modifiedXmlAsString1)

// Run the GetProductBySKUandID#Request
testRunner.testCase.testSuite.project.testSuites["Product_E2ESystem TestSuite"].testCases["Product_E2E System Testcase"].testSteps["GetProductBySKUandID"].run(testRunner,context)

// Get the response property from GetProductBySKUandID
def getProductResXml = context.expand('${GetProductBySKUandID#Response}')

// create an xml holder to get GetProductBySKUandID response
def Xmlhol3 = gUtil.getXmlHolder(getProductResXml)

//get product name and set product found as true
def product_name = Xmlhol3.getNodeValue("//*:name")
if (product_name != null)
{
log.info "New Product Found by Get product Service !"
log.info ("Product Name: " + product_name)
testRunner.testCase.setPropertyValue("NewProduct_name", product_name)
testRunner.testCase.setPropertyValue("NewProductFound", "TRUE")
}
